var div = document.querySelector("#container")

let cardItems;
const checkDataFromLocalStorage = JSON.parse(localStorage.getItem("cart"));
if (checkDataFromLocalStorage === null) {
cardItems = [];
} else {
cardItems = [...checkDataFromLocalStorage];
}

console.log(cardItems);


let carditems = []

mobilePhones.map((item, index) => {
    div.innerHTML += `
      <div class="card">
      <div class="card-image">
      <img src="${item.image}" />
      </div>
      <div class="content">
      <h2>${item.brand} ${item.model}</h2>
      <h5>Storage: ${item.ram} / ${item.rom}</h5>
      <h5>price $${item.price}</h5>
      <button id="addtocard" onclick="addtocard(${index})">Add to Cart</button>
      </div>
      </div>
      `;
  });



  function addtocard(index){
    var card = carditems.indexOf(mobilePhones[index])
    if(card === -1){
        mobilePhones[index].quantity = 1
        carditems.push(mobilePhones[index])
    }

    else{
        carditems[card].quantity += 1
        
    }

    Swal.fire({
        title: "Good job!",
        text: "You clicked the button!",
        icon: "success"
      });
    console.log(carditems)

  }


   function checkyourorder() {
           let cardss = JSON.stringify(carditems)
           localStorage.setItem("card",cardss)
           window.location = "card.html"
   }

  